import './AboutMe.css';
import React from 'react';

function AboutMe() {
  return (
    <section className='about-me'>
      <div className='about-me__container'>
        <h2 className='about-me__title'>Студент</h2>
        <hr className='about-me__divider' />
        <div className='about-me__student'>
          <div className='about-me__student-info'>
            <h3 className='about me__student-title'></h3>
            <h4 className='about-me__student-subtitle'></h4>
            <p className='about-me__student-paragraph'></p>
            <a className='about-me__student-link' href=""></a>
          </div>
        </div>
      </div>
    </section>
  );
}

export default AboutMe;
